import React, { useState } from 'react'

const Task = () => {

    const data = ["Karan", "alpesh", "harsh", "aniket", "jay"]

    const [name, setname] = useState(data[0]);
    const [number, setnumber] = useState(0)

    const changeValue = () => {
        setname(data[number + 1]);
        setnumber(number + 1);
    }

    return (
        <>
            <div>
                <input type="text" id="type" name="type" value="change" />
                <button onClick={ changeValue }>change</button>
            </div>
        </>
    )

};

export default Task
